import React, { Component } from 'react';
import styled from  'styled-components';


class About extends Component {

    render(){
        return(
            <DIV>
                <h1>개발기간은 약 2주정도 소요되었습니다.</h1>
                <h1>백엔드는 <Boot>Spring Boot</Boot> 를 사용하였고</h1>
                <h1>프론트엔드는 <Reactt>React</Reactt> 를 사용하였습니다.</h1>
                <h1>DB는 <Amazon>아마존의 RDS와 MariaDB</Amazon> 를 사용하였고</h1>
                <h1>서버는 <Amazon>아마존의 AWS</Amazon> 를 사용하였습니다.</h1>
            </DIV>
            
        )
    }

}

export default About;

const DIV = styled.div`
    margin-top: 100px;
`

const Boot = styled.b`
  color:green;
`

const Reactt = styled.b`
   color: blue;
`

const Amazon = styled.b`
   color: red;
`
